import React from "react";
import Navbar from "./Navbar";
import Logo from "./Logo";
import Search from "./Search";
import Footer from "./Footer";

const Menu = () => {
  return (
    <div style={{ width: "100vw", display: "flex" }}>
      <Navbar />
      <Logo />
      <Search />
      <Footer />
    </div>
  );
};
export default Menu;
